import { useState } from 'react'

const App = () => {
  const [ counter, setCounter ] = useState(0)
  const increment = () => setCounter(counter +1)
  const setZero = () => setCounter(0)

  return (
    <div>
      <div>{counter}</div>
      <button onClick={increment}>plus</button>
      <button onClick={setZero}>0</button>

    </div>
  )
}

export default App
